import React from 'react';
import PropTypes from 'prop-types';
import Typography from '@material-ui/core/Typography';

export default function Title(props) {
  return (
    <Typography component="h1" variant={props.variant} color="secondary" gutterBottom style={{ color: "#c16b53", fontWeight: "bold", paddingLeft: "7px" }}>
      {props.children}
    </Typography>
  );
}

Title.propTypes = {
  children: PropTypes.node,
};
